class guid{static short=()=>{var x,r=new Date().getTime();return"xxxxxxxx".replace(/[x]/g,function(x){var t=(r+16*Math.random())%16|0;return r=Math.floor(r/16),("x"==x?t:3&t|8).toString(16)})};static long=()=>{var x,r=new Date().getTime();return"xxxxxxxx-xxxx-xxxx-xxxx-xxxxxxxxxxxx".replace(/[x]/g,function(x){var t=(r+16*Math.random())%16|0;return r=Math.floor(r/16),("x"==x?t:3&t|8).toString(16)})}}